import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import SignIn from './Components/Login/SignIn';

function App() {
  return (
    <Router>
      <Route path="/register">
        <SignIn />
      </Route>
      <Route path="register">
        <SignIn />
      </Route>
    </Router>
  );
}

export default App;
